(3, 1, 1, 'Peluches', '<p><strong>Aquí encontrarás todas las colecciones de moda de mujer.</strong></p>\r\n<p>Esta categoría incluye todos los básicos de tu armario y mucho más:</p>\r\n<p>¡zapatos, complementos, camisetas estampadas, vestidos muy femeninos y vaqueros para mujer!</p>', 'peluches', '', '', ''),
(3, 1, 2, 'Peluches', '<p><strong>Aquí encontrarás todas las colecciones de moda de mujer.</strong></p>\r\n<p>Esta categoría incluye todos los básicos de tu armario y mucho más:</p>\r\n<p>¡zapatos, complementos, camisetas estampadas, vestidos muy femeninos y vaqueros para mujer!</p>', 'peluches', '', '', ''),
(4, 1, 1, 'Chicos', '<p>Aquí encontrarás camisetas, tops, blusas, camisetas de manga corta, de manga larga, sin mangas, de media manga y mucho más.</p>\r\n<p>¡Encuentra el corte que mejor te quede!</p>', 'chicos', '', '', ''),
(4, 1, 2, 'Chicos', '<p>Aquí encontrarás camisetas, tops, blusas, camisetas de manga corta, de manga larga, sin mangas, de media manga y mucho más.</p>\r\n<p>¡Encuentra el corte que mejor te quede!</p>', 'chicos', '', '', ''),
(5, 1, 1, 'Camisetas', '<p>Los must have de tu armario; ¡échale un vistazo a los diferentes colores,</p>\n<p>formas y estilos de nuestra colección!</p>', 'camisetas', '', '', ''),
(5, 1, 2, 'Camisetas', '<p>Los must have de tu armario; ¡échale un vistazo a los diferentes colores,</p>\n<p>formas y estilos de nuestra colección!</p>', 'camisetas', '', '', ''),
