(8, 1, 2, 'Grandes', '<p>¡Encuentra tus vestidos favoritos entre nuestra amplia colección de vestidos de noche, vestidos informales y vestidos veraniegos!</p>\r\n<p>Te ofrecemos vestidos para todos los días, para cualquier estilo y cualquier ocasión.</p>', 'grandes', '', '', ''),
